import React from "react";

interface ProductCardProps {
  product: any;
}

const ProductCard: React.FC<ProductCardProps> = ({ product }) => {
  return (
    <div className="border rounded-xl p-4 shadow-md w-full">
      <img src={product.images[0]} alt={product.name} className="rounded-xl w-full h-48 object-cover mb-2" />
      <h2 className="text-lg font-semibold mb-1">{product.name}</h2>
      <p className="text-sm text-gray-600 mb-2">{product.description}</p>
      <div className="text-xs text-gray-400">{product.tags.join(", ")}</div>
    </div>
  );
};

export default ProductCard;
